import logo from './logo.svg';
import './App.css';
import Router from './routes/Route';

function App() {
  return (
    <Routes>
    <Route path="/" element={
      <PrivateRoute>
        <Home />
      </PrivateRoute>
    } />
    </Routes>
  );
}

export default App;
